  input: '"TEXT","F3XA","C00039321","In response to your letter of December 30, 2005
    regarding your request for additional information on an earmarked contribution,
    please be advised that on November 3rd, 2005 the PepsiCo, Inc. Concerned Citizens
    Fund received a $5,000.00 contribution from Mr. Brock Leach of 5315 Hidden Harbor
    Rd, Sarasota, FL.  Mr. Leach requested that we earmark a portion of these funds
    as follows:   $1,100 to Senator Bill Nelson [D-FL] 2006 Primary Campaign;   $2,100
    to Senator Bill Nelson [D-FL] 2006 General Campaign.   The balance of $1,800 was
